Sarah Vandella - Only one way to save the store!

Added: March 09, 2011

Size:  674 Mb

Sarah works for a local grocer and no one is shoppoing there anymore because it is a lot cheaper at bigger stores. They need someone to make an all in offer to buy up all the stock for the month to stay afloat. Sarah knows what she needs to do.

